; /* Start:"a:4:{s:4:"full";s:49:"/local/js/gwd/formButtonDisabler.js?1707903925808";s:6:"source";s:35:"/local/js/gwd/formButtonDisabler.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
function disableClickedButton(button){
    button.dataset.dishtml = button.innerHTML;
    const rect = button.getBoundingClientRect();
    button.dataset.diswidth = button.style.width;
    button.dataset.disheight = button.style.height;
    button.style.width = Math.round(rect.width) + 'px';
    button.style.height = rect.height + 'px';
    button.setAttribute('disabled', 1);
    button.innerHTML = '<i class="fa fa-spinner fa-spin"></i>';
}
function enableClickedButton(button){
    button.innerHTML = button.dataset.dishtml;
    button.removeAttribute('disabled');
    button.style.width = button.dataset.diswidth;
    button.style.height = button.dataset.disheight;
    button.removeAttribute('data-dishtml');
    button.removeAttribute('data-diswidth');
    button.removeAttribute('data-disheight');
}
/* End */
