$(document).ready(function() {
    "use strict";


    if (document.getElementById('top_menu_toggle')) {
        let toggle = document.getElementById('top_menu_toggle');
        let menu = document.getElementById('header-menu');
        let shown = false;

        if(window.innerWidth >= 768){
            menu.style.right = (window.innerWidth - Math.round(toggle.getBoundingClientRect().right) + 10) + 'px';
        }

        toggle.addEventListener('click', function(e){
            window.requestAnimationFrame(function (){
                if(shown){
                    shown = !shown;
                    menu.classList.remove('--show');
                    document.body.classList.remove('--top-menu-shown');
                } else {
                    shown = !shown;
                    menu.classList.add('--show');
                    document.body.classList.add('--top-menu-shown');
                }
            });
        });
    }

    document.getElementById('header').addEventListener('click', e => {
        if (e.target.closest('.js-header-telegram-toggle')) {
            e.preventDefault();

            let button = e.target.closest('.js-header-telegram-toggle');

            if (button.getAttribute('disabled')) {
                e.stopPropagation();
                return false;
            }

            button.setAttribute('disabled', 1);
            button.style.opacity = '0.5';

            let guid = getCookie('tg_temp_group_guid');
            if (typeof guid == 'undefined') {
                guid = uuidv4();

                setCookie('tg_temp_group_guid', guid, {expires: 60 * 60 * 24 * 60});
            }

            console.log(guid);

            $.ajax('https://coretelegram.gwd.ru/bot/lk_bot/api/v1/groups/index.php?action=getTempGroup&guid=' + guid, {
                type: 'GET',
                async: true,
                success(json){

                    if (json.error === 0) {

                        document.location.href = json.result;

                    } else {
                        $.fancybox.open('-   ');
                    }
                },
                complete(){
                    button.removeAttribute('disabled');
                    button.style.opacity = '1';
                }
            })
        }
    });
});
